                // The input looks padded.
            }

            for (int col : activeCols) {
                // Check if beam is within bounds of the current row string
                if (col < 0 || col >= currentRow.length()) {
                    continue; // Exited manifold
                }

                char c = currentRow.charAt(col);
                if (c == '^') {
                    splitCount++;
                    // Splitter: beam stops.
                    // Creates new beams at col-1 and col+1.
                    // These new beams are conceptually at row `r`.
                    // They will move to `row+1` in the next step.
                    // We need to check if they exit the manifold or are valid.

                    if (col - 1 >= 0) {
                        nextRowCols.add(col - 1);
                    }
                    if (col + 1 < width) {
                        nextRowCols.add(col + 1);
                    }
                } else {
                    // '.' or 'S' (if encountered below?) or other chars?
                    // Beam continues straight down.
                    nextRowCols.add(col);
                }
            }
            activeCols = nextRowCols;

            if (activeCols.isEmpty()) {
                break;
            }
        }

        return splitCount;
    }
